import React from 'react';


const ProductCard = () => {


    return (

        <div className="card bg-dark text-white">
            <img className="card-img" src="images/example.jpg" alt="Example"/>
            <div className="card-img-overlay d-flex">
                <a className="align-self-center mx-auto" data-fancybox href="https://www.youtube.com/watch?v=dQw4w9WgXcQ">
                <i className="fa fa-youtube fa-5x zoom" ></i>
                </a>  
            </div>
        </div>
    )
}

export default ProductCard;
